import PropTypes from 'prop-types';
import Card from './Card/Card';
import CreateCard from './CreateCard/CreateCard';
import Drawer from '../shared/Drawer/Drawer';
import { useState } from 'react';

const Configurations = props => {
    const [isCollapsed, setIsCollapsed] = useState(false);

    return (
        <div className='px-6 py-10 grid grid-cols-3 gap-5'>
            <Card title={'Configuration 1'} text={"Today's New's Source, MGT"}>
                Nat config
            </Card>
            <Card title={'Configuration 2'} text={"Today's New's Source"}>
                Nat config 2
            </Card>
            <CreateCard />

            <Drawer isCollapsed={isCollapsed} setIsCollapsed={setIsCollapsed}>
                Configurations
            </Drawer>
        </div>
    );
};

Configurations.propTypes = {};

export default Configurations;
